import React, { useState } from "react";
import { FaPaperclip, FaPhone, FaEnvelope, FaMapMarkerAlt, FaLinkedin, FaGithub } from "react-icons/fa";

const contactInfo = {
  phone: "+91 7870503085",
  email: "chiranjeeviraj109@gmail.com",
  location: "India",
  socials: [
    { name: "LinkedIn", href: "https://linkedin.com/in/your-profile", icon: <FaLinkedin /> },
    { name: "GitHub", href: "https://github.com/your-profile", icon: <FaGithub /> },
  ],
};

export default function Contact() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    message: "",
    file: null,
  });

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: files ? files[0] : value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form Submitted:", formData);

    // Optional: Add EmailJS integration (uncomment and configure)
    /*
    import emailjs from "emailjs-com";
    emailjs.send("your_service_id", "your_template_id", formData, "your_user_id")
      .then(() => alert("Message sent successfully!"))
      .catch((error) => console.error("Error:", error));
    */

    setFormData({ name: "", email: "", message: "", file: null });
  };

  return (
    <section className="min-h-screen flex flex-col md:flex-row bg-gray-50 text-gray-900 px-4 sm:px-6 lg:px-8 py-12 md:py-16">
      <div className="w-full md:w-1/2 bg-gray-900 text-white p-8 flex flex-col justify-center rounded-lg md:rounded-r-none shadow-lg">
        <h3 className="text-lg text-gray-400 italic">Contact</h3>
        <h1 className="text-4xl md:text-5xl font-bold text-white mt-2">Reach Out to Me</h1>
        <div className="mt-6 space-y-4">
          <p className="flex items-center gap-3 text-gray-300">
            <FaMapMarkerAlt className="text-green-500" /> {contactInfo.location}
          </p>
          <p className="flex items-center gap-3 text-xl font-semibold">
            <FaPhone className="text-green-500" /> {contactInfo.phone}
          </p>
          <p className="flex items-center gap-3 text-xl font-semibold">
            <FaEnvelope className="text-green-500" /> {contactInfo.email}
          </p>
        </div>
        <div className="mt-8 flex gap-6">
          {contactInfo.socials.map((social, index) => (
            <a
              key={index}
              href={social.href}
              target="_blank"
              rel="noopener noreferrer"
              className="text-gray-400 hover:text-green-500 transition-colors duration-200"
              aria-label={social.name}
            >
              {social.icon}
            </a>
          ))}
        </div>
      </div>
      <div className="w-full md:w-1/2 bg-white p-8 flex flex-col justify-center rounded-lg md:rounded-l-none shadow-lg">
        <h2 className="text-2xl md:text-3xl font-semibold text-gray-900 mb-6">Have a Project?</h2>
        <form onSubmit={handleSubmit} className="space-y-6">
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <input
              type="text"
              name="name"
              placeholder="Your Name"
              value={formData.name}
              onChange={handleChange}
              className="border-b border-gray-300 p-3 text-gray-700 focus:border-green-500 focus:outline-none transition-colors duration-200"
              required
            />
            <input
              type="email"
              name="email"
              placeholder="Your Email"
              value={formData.email}
              onChange={handleChange}
              className="border-b border-gray-300 p-3 text-gray-700 focus:border-green-500 focus:outline-none transition-colors duration-200"
              required
            />
          </div>
          <textarea
            name="message"
            placeholder="Your Message"
            rows="4"
            value={formData.message}
            onChange={handleChange}
            className="w-full border-b border-gray-300 p-3 text-gray-700 focus:border-green-500 focus:outline-none transition-colors duration-200 resize-none"
            required
          ></textarea>
          <label className="flex items-center gap-2 text-gray-600 cursor-pointer hover:text-green-600 transition-colors duration-200">
            <FaPaperclip />
            <span>Attach File</span>
            <input
              type="file"
              name="file"
              onChange={handleChange}
              className="hidden"
            />
          </label>
          <button
            type="submit"
            className="w-full md:w-auto px-6 py-3 bg-green-600 text-white font-medium rounded-md hover:bg-green-700 transition-colors duration-200 flex items-center justify-center gap-2"
          >
            Submit Now <span>➡️</span>
          </button>
        </form>
      </div>
    </section>
  );
}
